import React from 'react';
  
const About = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
    >
      <h1>About us.</h1>
      <a>Abouuuutt</a>
    </div>
  );
};
  
export default About;
